import React from 'react';



// PersonalInfo Component
const PersonalInfo = (props) => {
  return (
    <div>
      <p>Name: {props.name}</p>
      <p>Age: {props.age}</p>
      <p>Occupation: {props.occupation}</p>
    </div>
  );
};

// Summary Component
const Summary = (props) => {
  const { name, age, occupation } = props.personalInfo;
  return (
    <div>
      <h2>My information</h2>
      <p>Name: {name}</p>
      <p>Age: {age}</p>
      <p>Occupation: {occupation}</p>
    </div>
  );
};

// App Component
function App() {
  const personalInfo = {
    name: "John Doe",
    age: 30,
    occupation: "Software Developer"
  };

  return (
    <div>
      <h1>Personal Information</h1>
      <PersonalInfo name="Jane Doe" age={28} occupation="Designer" />


     <Summary/>
     <personalInfo/>
    </div>
  );
}

export default App;
